catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }
	var rowObj = [];
	rowObj.push({
		"input_name": 'instance_type',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('instance_type')

	});
	rowObj.push({
		"input_name": 'aws_region_name',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('region_name')

	});
	g_form.setValue('inputs', JSON.stringify(rowObj));	

}
